import logo from './hulogo.png';
import './App.css';

function Header() {
    return (
      <header className="header">
        <img src={logo} alt="Hu Labs Logo" className="App-logo" />
        <nav>
          <ul>
              <li><a href="/">Home</a></li>
              <li><a href="/about">About</a></li>
              <li><a href="/services">Services</a></li>
              <li><a href="/contact">Contact</a></li>
          </ul>
        </nav>
      </header>
    );
  }
  export default Header;
